<html>
    <head>
        <title>Printing an array</title>
        <style>
            div{
                padding:5px;
            }
        </style>
    </head>
    <body>
        <div><h4>Printing an array in reverse order without using built in function</h4></div>
        <div>Check console for output..</div>
    </body>
</html>
<script>
    var inputArray=[33,44,11,33,44,555,11,11,45];
    var resultArray=[];
    
    console.log("Given Array: ");
    console.log(inputArray);
    console.log("Array printed in reverse order: ")

    for(var i=(inputArray.length-1);i>=0;i--){
        resultArray.push(inputArray[i]);
    }
    console.log(resultArray);
</script>
